import React from 'react';

function Competence() {
    return (
        <div className="container info">
            <h1>Competence</h1>
            <div className="row">
            <div class="progress">
                <div class="progress-bar" role="progressbar" style="width: 25%;" aria-valuenow="25" aria-valuemin="0" aria-valuemax="100">25%</div>
                </div>
            </div>
        </div>
    )
}

export default Competence;
